import { Route, Routes, useNavigate } from "react-router-dom";
import CreatePortfolio from "./components/CreatePortfolio";
import PaperTrade from "./PaperTrade";
import Home from "./components/Home";
import { useEffect, useState } from "react";
import { userID } from "./interfaces";
import React from "react";

class App extends React.Component {
  initialState = {
    token: "",
  };
  state = this.initialState;

  // componentDidUpdate() {
  //   if (this.state._id.$oid !== "") {
  //     this.navigate("/dashboard");
  //   }
  // }

  handleID(token: string) {
    this.setState({
      token: token,
    });
  }

  render() {
    this.handleID = this.handleID.bind(this);
    return (
      <div>
        <Routes>
          <Route
            path="*"
            element={<Home token={this.state.token} handleID={this.handleID} />}
          />
          {/* <Route path="/createportfolio" element={<CreatePortfolio />} /> */}
          <Route
            path="/dashboard"
            element={<PaperTrade token={this.state.token} />}
          />
        </Routes>
      </div>
    );
  }
}

export default App;
